svg.script:
var Button1 = document.getElementById("Button1");
var h1 = document.getElementById("h1");
var h2 = document.getElementById("h2");
var ces1 = document.getElementById("ces1");
var ces2 = document.getElementById("ces2");
var fis1 = document.getElementById("fis1");
var fis2 = document.getElementById("fis2");
var fis3 = document.getElementById("fis3");
var ges1 = document.getElementById("ges1");
var ges2 = document.getElementById("ges2");
var ges3 = document.getElementById("ges3");
var Aufloesung1 = document.getElementById("Aufloesung1");
var Aufloesung2 = document.getElementById("Aufloesung2");


function addEventListeners() {
    Button1.addEventListener('mouseover', haus);
    Button1.addEventListener('mouseout', han);
}

addEventListeners()

function haus() {
    h1.classList.remove("sichtbar");
    h1.classList.add("unsichtbar");
    h2.classList.remove("sichtbar");
    h2.classList.add("unsichtbar");

    fis1.classList.remove("sichtbar");
    fis1.classList.add("unsichtbar");
    fis2.classList.remove("sichtbar");
    fis2.classList.add("unsichtbar");
    fis3.classList.remove("sichtbar");
    fis3.classList.add("unsichtbar");

    Aufloesung1.classList.remove("sichtbar");
    Aufloesung1.classList.add("unsichtbar");
    Aufloesung2.classList.remove("sichtbar");
    Aufloesung2.classList.add("unsichtbar");

    ces1.classList.remove("unsichtbar");
    ces1.classList.add("sichtbar");
    ces2.classList.remove("unsichtbar");
    ces2.classList.add("sichtbar");

    ges1.classList.remove("unsichtbar");
    ges1.classList.add("sichtbar");
    ges2.classList.remove("unsichtbar");
    ges2.classList.add("sichtbar");
    ges3.classList.remove("unsichtbar");
    ges3.classList.add("sichtbar");

    Button1.classList.remove("sichtbar");
    Button1.classList.add("halb");
}

function han() {
    h1.classList.remove("unsichtbar");
    h1.classList.add("sichtbar");
    h2.classList.remove("unsichtbar");
    h2.classList.add("sichtbar");

    fis1.classList.remove("unsichtbar");
    fis1.classList.add("sichtbar");
    fis2.classList.remove("unsichtbar");
    fis2.classList.add("sichtbar");
    fis3.classList.remove("unsichtbar");
    fis3.classList.add("sichtbar");

    Aufloesung1.classList.remove("unsichtbar");
    Aufloesung1.classList.add("sichtbar");
    Aufloesung2.classList.remove("unsichtbar");
    Aufloesung2.classList.add("sichtbar");

    ces1.classList.remove("sichtbar");
    ces1.classList.add("unsichtbar");
    ces2.classList.remove("sichtbar");
    ces2.classList.add("unsichtbar");

    ges1.classList.remove("sichtbar");
    ges1.classList.add("unsichtbar");
    ges2.classList.remove("sichtbar");
    ges2.classList.add("unsichtbar");
    ges3.classList.remove("sichtbar");
    ges3.classList.add("unsichtbar");

    Button1.classList.remove("halb");
    Button1.classList.add("sichtbar");
}
